import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import Home from './pages/Home';
import About from './pages/About';
import Collection from './pages/Collection';
import Account from './pages/Account';
import Dashboard from './pages/Dashboard';
import Checkout from './pages/CheckOut';
import Login from './pages/Login';
import Register from './pages/Register';
import OrderForm from './pages/OrderForm'; // Import the OrderForm page
import ProtectedRoute from './components/ProtectedRoute'; // Wrapper for protected routes
import { AuthProvider } from './context/AuthContext'; // Context for authentication
import './App.css';

function App() {
    return (
        <AuthProvider>
            <Router>
                <Navbar />
                <div className="app-container">
                    <Routes>
                        {/* Public Routes */}
                        <Route path="/" element={<Home />} />
                        <Route path="/about" element={<About />} />
                        <Route path="/collection" element={<Collection />} />
                        <Route path="/login" element={<Login />} />
                        <Route path="/register" element={<Register />} />

                        {/* User Account Routes */}
                        <Route 
                            path="/account" 
                            element={
                                <ProtectedRoute>
                                    <Account />
                                </ProtectedRoute>
                            } 
                        />
                        <Route 
                            path="/dashboard" 
                            element={
                                <ProtectedRoute>
                                    <Dashboard />
                                </ProtectedRoute>
                            } 
                        />

                        {/* Checkout and Order Form */}
                        <Route 
                            path="/order-form" 
                            element={
                                <ProtectedRoute>
                                    <OrderForm />
                                </ProtectedRoute>
                            } 
                        />
                        <Route 
                            path="/checkout" 
                            element={
                                <ProtectedRoute>
                                    <Checkout />
                                </ProtectedRoute>
                            } 
                        />
                    </Routes>
                </div>
                <Footer />
            </Router>
        </AuthProvider>
    );
}

export default App;
